import React from 'react';
import {GoogleOutlined, MicrosoftOutlined} from '@ant-design/icons';

const Login = () => {
    return(
        <div id="login-page">
            <div id="login-card">
                <h2>Welcome to Microsoft Teams!</h2>
                <div className="login-button google">
                    <GoogleOutlined /> Sign in with Google
                </div>
                <br/><br/>
                <div className="login-button microsoft">
                    <MicrosoftOutlined /> Sign in with Microsoft
                </div>
            </div>
        </div>
    );
}

export default Login
